  return (
    <div className="o-row">
    <div className="o-col  t-site-header__menu">
      <div className="c-nav">
          <button className="c-nav__item">
            <NavLink exact to="/">>Start</NavLink></button>
          <button className="c-nav__item">
            <a href="#O co chodzi" className="c-nav__link">O co chodzi</a></button>
          <button className="c-nav__item">
            <a href="#O nas" className="c-nav__link">O nas</a></button>
