            <a href="#Fundacje i organizacje" className="c-nav__link">Fundacje i  organizacje</a></button>
          <button className="c-nav__item">
            <a href="#Kontakt" className="c-nav__link">Kontakt</a></button>
      </div>
    </div>
    </div>
  )
}

export default Menu;
